package org.example.other;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

public class Question438 {
    public static void main(String[] args) {
        new Question438().findAnagrams("", "");
    }

    public List<Integer> findAnagrams(String s, String p) {
        HashMap<Character, Integer[]> map = new HashMap<>();

        for (int i = 0; i < p.toCharArray().length; i++) {
            if (map.containsKey(p.charAt(i))) {
                map.get(p.charAt(i))[0]++;
            } else {
                Integer[] num = {1, 0};
                map.put(p.charAt(i), num);
            }
        }

        List<Integer> res = new ArrayList<>();

        int left = 0;
        int right = 0;

        while (right < s.length()) {
            if (right < p.length()) {
                if (map.containsKey(s.charAt(right)))
                    map.get(s.charAt(right))[1]++;
            } else {
                if (map.containsKey(s.charAt(left)))
                    map.get(s.charAt(left))[1]--;
                left++;
                if (map.containsKey(s.charAt(right))) {
                    map.get(s.charAt(right))[1]++;
                }

            }

            if (right - left + 1 == p.length()) {
                boolean flag = true;
                for (Character c : map.keySet()) {
                    // if (map.get(c)[0] != map.get(c)[1]) {
                    //
                    // }
                    int a = map.get(c)[0];
                    int b = map.get(c)[1];
                    if (a != b) {
                        flag = false;
                        break;
                    }
                }
                if (flag) {
                    res.add(left);
                }
            }

            right++;
        }

        return res;

    }
}
